import "./Posts.css"
import Post from "./Post";

export default function Posts({listOfPosts}){
    return(
        <div className="posts">

            {listOfPosts.map(post => {
                return(
                    <ul>
                        <li>{post.title}</li>
                        <li>{post.subject}</li>
                        <li>{post.content}</li>
                    </ul>
                )
            })}
        </div>
    )
}
